INSERT INTO `menu` VALUES (1,'나이트로 바닐라 크림',5300,'%EB%82%98%EC%9D%B4%ED%8A%B8%EB%A1%9C%20%EB%B0%94%EB%8B%90%EB%9D%BC%20%ED%81%AC%EB%A6%BC.jpg','75','부드러운 목넘김의 나이트로 커피와 바닐라 크림의 매력을 한번에 느껴보세요!','콜드 브루'),(2,'나이트로 콜드 브루',5300,'%EB%82%98%EC%9D%B4%ED%8A%B8%EB%A1%9C%20%EC%BD%9C%EB%93%9C%20%EB%B8%8C%EB%A3%A8.jpg','5','나이트로 커피 정통의 캐스케이딩과 부드러운 콜드 크레마!부드러운 목 넘김과 완벽한 밸런스에 커피 본연의 단맛을 경험할 수 있습니다.','콜드 브루'),(3,'돌체 콜드 브루',5300,'%EB%8F%8C%EC%B2%B4%20%EC%BD%9C%EB%93%9C%20%EB%B8%8C%EB%A3%A8.jpg','265','무더운 여름철, 동남아 휴가지에서 즐기는 커피를 떠오르게 하는 스타벅스 음료의 베스트 x 베스트 조합인돌체 콜드 브루를 만나보세요! ','웹사이트 비노출 메뉴(사이렌오더 영양정보 연동)'),(4,'바닐라 크림 콜드 브루',5300,'%EB%B0%94%EB%8B%90%EB%9D%BC%20%ED%81%AC%EB%A6%BC%20%EC%BD%9C%EB%93%9C%20%EB%B8%8C%EB%A3%A8.jpg','125','콜드 브루에 더해진 바닐라 크림으로 깔끔하면서 달콤한 콜드 브루를 새롭게 즐길 수 있는 음료입니다.','콜드 브루'),(5,'제주 비자림 콜드 브루',5300,'%EC%A0%9C%EC%A3%BC%20%EB%B9%84%EC%9E%90%EB%A6%BC%20%EC%BD%9C%EB%93%9C%20%EB%B8%8C%EB%A3%A8.jpg','340','[제주지역 한정음료] 제주 천년의 숲 비자림을 연상시키는 음료로 제주에서 유기농 말차로 만든 파우더와 Cold Brew를 활용한 음료.','콜드 브루'),(6,'콜드 브루',5300,'%EC%BD%9C%EB%93%9C%20%EB%B8%8C%EB%A3%A8.jpg','5','스타벅스 바리스타의 정성으로 탄생한 콜드 브루!콜드 브루 전용 원두를 차가운 물로 14시간 동안 추출하여 한정된 양만 제공됩니다.깊은 풍미의 새로운 커피 경험을 즐겨보세요.','웹사이트 비노출 메뉴(사이렌오더 영양정보 연동)'),(7,'콜드 브루 몰트',5300,'%EC%BD%9C%EB%93%9C%20%EB%B8%8C%EB%A3%A8%20%EB%AA%B0%ED%8A%B8.jpg','510','[리저브 전용음료] 리저브 콜드 브루, 바닐라 아이스크림, 몰트가 블렌딩된 리저브만의 쉐이크','콜드 브루'),(8,'콜드 브루 플로트',5300,'%EC%BD%9C%EB%93%9C%20%EB%B8%8C%EB%A3%A8%20%ED%94%8C%EB%A1%9C%ED%8A%B8.jpg','230','[리저브 전용음료] 리저브 콜드 브루 위에 녹아 내리는 한 스쿱의 바닐라 아이스크림','콜드 브루'),(9,'아이스 커피',4000,'%EC%95%84%EC%9D%B4%EC%8A%A4%20%EC%BB%A4%ED%94%BC.jpg','5','깔끔하고 상큼함이 특징인 시원한 아이스 커피','브루드 커피'),(10,'오늘의 커피',4000,'%EC%98%A4%EB%8A%98%EC%9D%98%20%EC%BB%A4%ED%94%BC.jpg','5','신선하게 브루드(Brewed)되어 원두의 다양함이 살아있는 커피','브루드 커피'),(11,'슈크림 라떼',5600,'%EC%8A%88%ED%81%AC%EB%A6%BC%20%EB%9D%BC%EB%96%BC.jpg','315','오리지널 슈크림의 맛을 그대로 재현한, 봄을 알리는 스타벅스의 시그니처 음료 슈크림 라떼','2021 Spring'),(12,'아이스 슈크림 라떼',5600,'%EC%95%84%EC%9D%B4%EC%8A%A4%20%EC%8A%88%ED%81%AC%EB%A6%BC%20%EB%9D%BC%EB%96%BC.jpg'